    public static long getAns2(int[] atk) {
        long start = System.currentTimeMillis();
        if (null == atk || atk.length == 0) {
            return 0;
        }
        int len = atk.length;
        Arrays.sort(atk);
        long sum = 0;
        for (int i = 0; i < len; i++) {
            for (int j = 0;j < len - i - 1; j++) {
                sum += atk[j];
            }
        }
        System.out.println(System.currentTimeMillis() - start);//112
        return sum;
    }


    /**
     * @param atk: the atk of monsters
     * @return: Output the minimal damage QW will suffer
     */
    public static long getAns(int[] atk) {
        long start = System.currentTimeMillis();
        if (null == atk || atk.length == 0) {
            return 0;
        }
        int len = atk.length;
        int max = 0;
        int n = 0;
        long sum = 0;
        for (int i = 0; i < len; i++) {
            max = 0;
            for (int j = 0;j < len - i; j++) {
                if (atk[j] > max) {
                    max = atk[j];
                    n = j;
                }
            }
            atk[n] = atk[len - 1 - i];
            atk[len - 1 - i] = 0;
            for (int j = 0;j < len - i; j++) {
                sum += atk[j];
            }
        }
        System.out.println(System.currentTimeMillis() - start);//334
        return sum;
    }
